// data.js
import React from 'react';
import { NavLink } from 'react-router-dom';

function Episode(id, title, description, audioUrl) {
  return { id, title, description, audioUrl };
  
}
const Podcast = ({ podcast }) => (
  <div>
    <h2>{podcast.title}</h2>
    <p>{podcast.description}</p>
    <NavLink to={`/podcasts/${podcast.id}`} >Voir les épisodes</NavLink>
  </div>
);

const episodesData = [
  Episode(1, 'Episode 1', 'Description of Episode 1', 'audio1.mp3'),
  Episode(2, 'Episode 2', 'Description of Episode 2', 'audio2.mp3'),
  // ... autres épisodes
];

const podcastsData = [
  // ... autres podcasts
  Podcast(1, 'Podcast 1', 'Description of Podcast 1', [episodesData[0], episodesData[1]]),
  Podcast(2, 'Podcast 2', 'Description of Podcast 2', [episodesData[2], episodesData[3]]),
  // ... autres podcasts
];

export { episodesData, podcastsData };
